import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <Fragment>
            <div className="container">
            <h1>This Home page</h1>
            <Link to="/clients">View Clients</Link>
            </div>
        </Fragment>
    );
}

export default Home;
